// src/app/store.js
import { configureStore } from "@reduxjs/toolkit";
import { apiSlice } from "./features/api/apiSlice";
import todosReducer from "./features/api/todoslice";

export const store = configureStore({
  reducer: {
    todos: todosReducer,
  },
});
